import Spinner from 'react-bootstrap/Spinner';

function LoadingSpinner() {
    return (
      <div 
        style={{
          position: 'fixed',
          top: '50%',
          left: '50%',
          transform: 'translate(-50%, -50%)'
        }}
      >
        <Spinner 
          animation="border" 
          role="status"
          style={{ 
            width: '5rem', 
            height: '5rem'
          }}
        >
          <span className="visually-hidden">Loading...</span>
        </Spinner>
      </div>
    );
  }

export default LoadingSpinner;
